import React from 'react';
import { Mail, Phone, MapPin, Linkedin, Github, Instagram } from 'lucide-react';
import './index.scss'

const Contact = () => {
  const socialLinks = [
    { icon: Linkedin, url: 'https://linkedin.com', label: 'LinkedIn' },
    { icon: Github, url: 'https://github.com', label: 'GitHub' },
    { icon: Instagram, url: 'https://instagram.com', label: 'Instagram' }
  ];

  return (
    <div className="min-h-screen bg-gray-100 flex items-center justify-center p-4">
      <div className="bg-white shadow-lg rounded-lg p-8 max-w-md w-full">
        <div className="text-center mb-6">
          <img 
            src="/api/placeholder/150/150" 
            alt="Profile" 
            className="rounded-full mx-auto mb-4 w-36 h-36 object-cover"
          />
          <h1 className="text-2xl font-bold text-gray-800">Your Name</h1>
          <p className="text-gray-600">Professional Title</p>
        </div>

        <div className="space-y-4">
          <div className="flex items-center space-x-3">
            <Mail className="text-blue-500 w-6 h-6" />
            <span>email@example.com</span>
          </div>
          <div className="flex items-center space-x-3">
            <Phone className="text-green-500 w-6 h-6" />
            <span>+1 (123) 456-7890</span>
          </div>
          <div className="flex items-center space-x-3">
            <MapPin className="text-red-500 w-6 h-6" />
            <span>City, Country</span>
          </div>
        </div>

        <div className="mt-6 flex justify-center space-x-4">
          {socialLinks.map(({ icon: Icon, url, label }) => (
            <a 
              key={label} 
              href={url} 
              target="_blank" 
              rel="noopener noreferrer" 
              className="text-gray-600 hover:text-blue-500 transition-colors"
            >
              <Icon className="w-6 h-6" />
            </a>
          ))}
        </div>
      </div>
    </div>
  );
};

export default Contact;
